import React from 'react';
import { Link } from 'react-router-dom';
import { Sidenav, Nav, Icon } from 'rsuite';

const headerStyles = {
  padding: 20,
  fontSize: 16,
  background: '#34c3ff',
  color: '#fff'
};

class Sidebar extends React.Component {
  constructor() {
    super();
    this.state = {
      expanded: true,
      activeKey: '1',
    };
    
  }
  render() {
    return (
      <div style={{ width: 250 }}>
        <Sidenav>
          <Sidenav.Header>
            <div style={headerStyles}>Inventory Tracker</div>
          </Sidenav.Header>
          <Sidenav.Body>
            <Nav>
              <Nav.Item eventKey="1" active icon={<Icon icon="dashboard" />}>
                <Link to="/dashboard"> Dashboard </Link>
              </Nav.Item>
              <Nav.Item eventKey="2" icon={<Icon icon="list" />}>
                <Link to='/inventory'> Inventory </Link>
              </Nav.Item>
              <Nav.Item eventKey="3" icon={<Icon icon="retention" />}>
                <Link to='/recipes'> Recipes </Link>
              </Nav.Item>
              <Nav.Item eventKey="4" icon={<Icon icon="tag" />}>
                <Link to='/orders'> Orders </Link>
              </Nav.Item>
              <Nav.Item eventKey="5" icon={<Icon icon="credit-card-alt" />}>
                <Link to='/budget'> Budget </Link>
              </Nav.Item>
              <Nav.Item eventKey="6" icon={<Icon icon="charts" />}>
                <Link to='/reports'> Reports </Link>
              </Nav.Item>
              <Nav.Item eventKey="7" icon={<Icon icon="bookmark-o" />}>
                <Link to='/goals'> Goals </Link>
              </Nav.Item>
            </Nav>
          </Sidenav.Body>
        </Sidenav>
      </div>
    )
  }
  
}

export default Sidebar;
